import {
  loadChofers,
  createChofers,
  updateChoferes,
  deleteChoferes,
  clearchoferes,
} from "../../actions/choferesActions";

import service from '../../helpers/services'

const getChoferes = () =>{
      return dispatch => {
          service.get("http://10.53.3.3:8080/api/v1/choferes/").then((res) => {
            console.log("ver res", res);
            dispatch(loadChofers(res));
          });
      }
}

export default {getChoferes};
